import React from 'react'
// Sample data for past results
const pastResults = [
    { year: 2023, percentage: 85 },
    { year: 2022, percentage: 82 },
    { year: 2021, percentage: 78 },
    { year: 2020, percentage: 75 },
];
function OverPastResult() {
    return (
        <section className="py-12 bg-gray-100 h-screen pt-">
            <div className="container mx-auto px-4">
                <h2 className="text-3xl font-semibold text-center mb-8">Past Results</h2>
                <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6">
                    {pastResults.map(result => (
                        <div key={result.year} className="bg-white shadow-md p-6 rounded-lg">
                            <h3 className="text-lg font-semibold mb-2">{result.year}</h3>
                            <p className="text-gray-600">{result.percentage}% Pass Rate</p>
                        </div>
                    ))}
                </div>
            </div>
        </section>
    );
}

export default OverPastResult
